DROP TABLE `donors`;

CREATE TABLE `donors` (
  `id` INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL,
  `first_name` varchar(255) default NULL,
  `last_name` varchar(255) default NULL,
  `address` varchar(255) default NULL,
  `dob` varchar(255),
  `users_id` mediumint default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

